import "./navbar.css"

const Navbar = () => {
    return (
        <div className="navbar">
            <div className="navbarContainer">
                <span className="logo">bookingwebsite</span>
                <div className="navItems">
                    <button className="navButton">Register</button>
                    <button className="navButton">Login</button>
                </div>
            </div>
        </div>
    )
}

const Nav = () => {
    return (
      <div className="header-container">
        <h1 className="header-title">cord's blogsite</h1>
        <div className="header-sub">
          <Link className="header-buttons" to={"/"}>My Blogs</Link>
          <Link className="header-buttons" to={"/author"}>About the Author</Link>
          <Link className="header-buttons" to={"/empty"}>Empty Page Tester</Link>
        </div>
      </div>
    );
  }

export default Navbar
